import React from "react";
import { FaLinkedin, FaInstagram, FaReact, FaCss3Alt } from "react-icons/fa";
import { AiOutlineMail, AiFillGithub } from "react-icons/ai";
import { colors } from "../../styling/colors";

function Footer({

}) {
    return (
        <div 
          className="footer_bar"
          style={{ backgroundColor: colors.green }}
        >
            <ul>
                <li className="footer_content_left">
                    <a href="https://www.linkedin.com/in/raymondxyz/"><FaLinkedin color={colors.white} size="30px"></FaLinkedin></a>
                </li>
                <li className="footer_content_left">
                    <a href="https://github.com/raymondxyz"><AiFillGithub color={colors.white} size="30px"></AiFillGithub></a>
                </li>
                <li className="footer_content_left">
                    <a href="https://www.instagram.com/raymond.xyz/"><FaInstagram color={colors.white} size ="30px"></FaInstagram></a>
                </li>
                <li className="footer_content_left"> 
                    <a href="mailto:raymondxyzhang@gmail.com"><AiOutlineMail color={colors.white} size="30px"></AiOutlineMail></a>
                </li>
            </ul>
            <div className="footer_content_right">
                <p>
                    Made using <FaReact color={colors.black} size="25px"></FaReact>
                     & <FaCss3Alt color={colors.black} size="25px"></FaCss3Alt>.
                    Raymond Zhang {new Date().getFullYear} {new Date().getMonth}
                </p>
            </div>
        </div>
    )
}

export default Footer
